import React from 'react';
import { Jumbotron as Jumbo, Container, Row, Col, Image } from 'react-bootstrap';
import styled from 'styled-components';
import projImage from '../assets/Asset_2.png';
import meImage from '../assets/me.jpg';

const Styles = styled.div`
  .jumbo {
    background: url(${projImage}) no-repeat fixed bottom;
    background-size: cover;
    background-color: #1A2349;
    color: white;
    height:400px;
    position: relative;
  }

  .img-fluid {
      max-height: 73%;
  }

  .des-cont {
      color: #EAEAEA;
  }
`;


export const Jumbotron = () => (
    <Styles>
    <Jumbo fluid className="jumbo" > 
      <div className="overlay" bg="dark" ></div>
      <Container>
      <Row>
    <Col xs={6} md={4}>
    <Image src={meImage} roundedCircle />
    </Col>
    <Col xs={12} md={8}>
    <h1><b>Mireya Rodriguez</b></h1>
    </Col>
  </Row>


      </Container>
    </Jumbo>
    </Styles>


)
